import { AbstractControl } from "@angular/forms";

export function formValidation(control:AbstractControl):{[key:string]:boolean}|null{
    const origin=control.get('origin');
    const destination=control.get('destination');
    return origin && destination && origin.value == destination.value?
    {'Match':true}:
    null;
  }
